export const addPost = (post) => ({
    type: 'ADD_POST',
    payload: post
  });
  
  export const setPosts = (posts) => ({
    type: 'SET_POSTS',
    payload: posts
  });

export const DELETE_POST = 'DELETE_POST';

export const deletePost = (postId) => ({
  type: DELETE_POST,
  payload: postId,
});
